import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import{dark,light} from './store'
export default function Theme() {
    const color=useSelector((data)=>data.colors.color);
    const dispatch=useDispatch()
  return (
    <div>
        <button onClick={()=>dispatch(dark(1))}>add</button>
        {color}
        <button onClick={()=>dispatch(light(1))}>moin</button>
    </div>
  )
}
